 of webpages and saves them to a folder on your computer. The extension should have a button that, when clicked, takes a screenshot of the current webpage and saves it to the folder. The extension should also have a settings page where the user can specify the folder to save the screenshots to.

Here is a sample code for a chrome extension that takes screenshots of webpages and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A chrome extension that takes screenshots of webpages and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "storage",
    "tabs"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}

// background.js
chrome.runtime.onInstalled.addListener(function() {
  chrome.storage.sync.set({folder: ""}, function() {
    console.log("Folder set to empty string.");
  });
});

chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === "complete") {
    chrome.storage.sync.get(["folder"], function(result) {
      if (result.folder) {
        chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
          var filename = result.folder + "/" + tab.title + ".png";
          chrome.downloads.download({
            url: dataUrl,
            filename: filename
          });
        });
      }
    });
  }
});

// popup.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <link rel="stylesheet" href="style.css">
  </ head>
  <body>
    <h1>Screenshot Extension</h1>
    <p>Click the button below to take a screenshot of the current webpage and save it to the specified folder.</p>
    <button id="take-screenshot">Take Screenshot</button>
    <div id="status"></div>
    <script src="popup.js"></script>
  </body>
</html>

// popup.js
document.getElementById("take-screenshot").addEventListener("click", function() {
  chrome.storage.sync.get(["folder"], function(result) {
    if (result.folder) {
      chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
        var filename = result.folder + "/" + document.title + ".png";
        chrome.downloads.download({
          url: dataUrl,
          filename: filename
        });
      });
    } else {
      document.getElementById("status").innerHTML = "Please specify a folder to save screenshots to.";
    }
  });
});
```
