You need to install the typescript definitions for readline-sync. You can do this by running the following command:
npm install --save-dev @types/readline-sync
This will install the typescript definitions for readline-sync in your project's node_modules folder. You can then import readline-sync in your typescript file like this:
import * as readlineSync from 'readline-sync';
var input = readlineSync.question("Enter your name: ");
console.log("Hello " + input + "!");
Note that you need to use the * as readlineSync syntax to import all the types from the readline-sync module.
