## 1. Inline Styles

Inline styles are the most basic way to style a react app. You can use the style prop to add inline styles to any react component. The style prop takes an object with CSS properties as keys and values as values. For example, to add a background color to a div, you can use the following code:
```
<div style={{ backgroundColor: 'red' }}>Hello World!</div>
```
## 2. CSS Modules

CSS Modules allow you to write CSS in a scoped way, which means that the CSS rules are only applied to the component where they are defined. To use CSS Modules, you need to create a CSS file and import it into your react component. For example, to create a CSS file called styles.css and import it into a react component, you can use the following code:
```
import React from 'react';
import styles from './styles.css';

const App = () => {
  return (
    <div className={styles.container}>
      <h1 className={styles.title}>Hello World!</h1>
    </div>
  );
};

export default App;
```
